generated.css:
html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed,
figure, figcaption, footer, header, hgroup,
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline; }

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure,
footer, header, hgroup, menu, nav, section {
  display: block; }

body {
  line-height: 1; }

ol, ul {
  list-style: none; }

blockquote, q {
  quotes: none; }

blockquote:before, blockquote:after,
q:before, q:after {
  content: '';
  content: none; }

table {
  border-collapse: collapse;
  border-spacing: 0; }

header {
  background-color: #b5f7b5;
  height: 3rem;
  padding: 2rem; }
  header h1 {
    text-align: center;
    font-size: 2rem;
    text-transform: uppercase;
    color: #bbbbbb; }

.search-seactio {
  text-align: center;
  margin-top: 3rem; }
  .search-seactio .find-book {
    height: 3rem;
    width: 25rem;
    border: none;
    background-color: #b5f7b5;
    color: white;
    font-size: 1rem; }

button {
  outline: none;
  height: 55px;
  text-align: center;
  width: 9rem;
  border-radius: 40px;
  background: #fff;
  border: 2px solid #b5f7b5;
  color: #b5f7b5;
  letter-spacing: 1px;
  text-shadow: 0;
  font-size: 20px;
  font-weight: bold;
  cursor: pointer;
  transition: all 0.25s ease; }
  button:hover {
    color: white;
    background: #b5f7b5; }
  button:active {
    letter-spacing: 2px; }
  button:after {
    content: "SEARCH"; }
